package fslRune

// data come from chrome 84 on macOs 10.15.4(2020-03-24), older operation system may seen some tofu.
func IsRuneNoTofu(r rune) bool{
	hr:=int(r>>16)
	if hr>=len(gDataIsRuneNoTofu){
		return false
	}
	ranges:=gDataIsRuneNoTofu[hr]
	r16:=uint16(r&0xffff)
	lo := 0
	hi := len(ranges)
	for lo < hi {
		m := lo + (hi-lo)/2
		range_ := ranges[m]
		if range_[0] <= r16 && r16 <= range_[1] {
			return true
		}
		if r16 < range_[0] {
			hi = m
		} else {
			lo = m + 1
		}
	}
	return false
}

